	//Takes a string and pieces it into 5 letter words, adds it to wordList
	public void setUpWords(String s){
		int index = 0;
		for(int i=0; i<s.length()/6; i++) {
			wordList.add(s.substring(index, index+5));
			index += 6;
		}
	}
	
	//Returns the full word list
	public ArrayList<String> getWordList(){
		return wordList;
	}
	
	//Returns the guessable word list
	public ArrayList<String> getGuessableWordList(){
		return guessableWordList;
	}
	
	//Takes a string and pieces it into 5 letter words, adds it to guessableWords
	public void gWords(String s) {
		for(int i=0; i<s.length(); i+=7) {
			String ret = s.substring(i, i+5);
			ret = ret.toUpperCase();
			guessableWordList.add(ret);
		}
	}
	
